def solution(stdin: str) -> str:
    n, x, y = map(int, stdin.split())
    # 10^(x) < 2^(y)
    # x >= y
    if n == 1:
        if y == 0:
            return "1"
        else:
            return "0"
    else:
        max_power_of_10 = 10 ** x
        max_power_of_y = 10 ** y
        min_power_of_10 = max_power_of_10 // max_power_of_y
        if n < min_power_of_10:
            return str(n)
        else:
            # Return minimum number of operations
            # to obtain the number having remainder 10^y
            return str(n - min_power_of_10)

